import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import TargetList from './TargetList';
import SuppressionList from './SuppresionList';


function Navbar() {
    return (
        <BrowserRouter>
    <Router>
         <Route path = "home" component = {TargetList} />
         <Route path = "about" component = {SuppressionList} />
     
   </Router>
   </BrowserRouter>
    )
}

export default Navbar
